dually. Join the waitlist and we’ll let you know as soon as it’s your turn!\",\"bCmvTYWKoj\":\"Give feedback\",\"bDGyh6+piN\":\"OAuth Client Secret\",\"bDnAHgBI44\":\"Forest explorer\",\"bDqBQW1dDf\":\"Access restricted by network policy.\",\"bEq+NWNIXF\":\"Unshare\",\"bF+qsG1XQ1\":\"Handle larger codebases without hitting limits\",\"bFl1yhylgx\":\"Your connector was connected. You can now use it with Claude.\",\"bH47Z4hSE8\":\"Ask {name}\",\"bHMcz2sr6C\":\"Last synced {relativeTime}\",\"bHSlU6I+PS\":\"Strategize\",\"bHdGgxffFR\":\"ZIP file that includes exactly one SKILL.md file at the root level\",\"bL7dVUkHa0\":\"Chat paused\",\"bLEGIyr72h\":\"Content is not stored after matching style.\",\"bLSTJZMB82\":\"Simplify daily tasks with Claude-created utility tools and practical applications. From helpful assistants and problem-solvers to everyday helpers and convenience tools, these utilities address common needs and challenges. Designed for real-world use, they make routine tasks easier and more efficient.\",\"bMqfGRVujK\":\"Something went wrong while sharing this conversation. Please refresh the page.\",\"bPY0siM1l3\":\"Claude installs packages and libraries to perform advanced data analysis, custom visualizations, and specialized file processing. Allowed domains can be managed in \u003clink\u003eSettings\u003c/link\u003e.\",\"bPbVRCNTvD\":\"Create an interactive react app to let people watch their favorite historical events in SVG. Users will enter the name of a historical event, then it will generate a series of SVG’s representing famous scenes from that event. The setting should be a cinema, and the SVG’s should be played in the screen. Make sure it fits within the bounds of the screen. Use the claude API to generate the SVG’s. Use the analysis tool to check how to use the API first. The user should really feel as if they are at the movies, make it immersive! The SVG images should be representative of the scene and obvious to anyone who is familiar with that historical event. Aim to wow the user with your SVG skills! Write a very good prompt to claude for generating the SVG to get this point across. Generate 1-5 famous scenes specific to the specified historical event. Ensure that everything works, do not mock any functionality. Ensure that the react app looks like a movie theatre and that all the pieces fit together.\",\"bPeEcbMp7Q\":\"Wander through an endless Japanese tea garden where cherry blossoms bloom eternal\",\"bQuLbzZRDC\":\"\u003cbutton\u003eAuthenticate\u003c/button\u003e to export to Google Drive\",\"bSZyad19yM\":\"Search and reference chats\",\"bUAgyhz8so\":\"Unsubscribe from unwanted email chains\",\"bUCQHXUsUI\":\"Unlimited projects to organize chats\",\"bVv2xNXyVj\":\"Uninstall\",\"bW7B87wFFp\":\"New\",\"bWOZ/KETZU\":\"Recurring charges\",\"bWRp6wwzXA\":\"Use caution before running this prompt. Malicious conversation content could trick Claude into attempting harmful actions or sharing your data.\",\"bX4TtwGqmk\":\"Warning: No Groups Detected\",\"bXAswF0AK8\":\"Usage limit reached — your limit will reset at {time}.\",\"bXLLomFyZf\":\"Starting conversation on...\",\"bXSQXHTTLY\":\"Design a presentation layout\",\"bXa+lJhlYV\":\"Share chat\",\"bXi7v52sdL\":\"What changed about your work or workflow that reduced your need for Claude?\",\"bXkNSli+MX\":\"We are experiencing delivery issues with some email providers and are working to resolve this.\",\"bZMLuJCUfp\":\"DNS changes may take time to propagate across name servers. You can \u003clink\u003echeck the current propagation status\u003c/link\u003e to monitor when your record becomes visible.\",\"baZxJaoyS9\":\"Quick chat\",\"bbgQqH7Grg\":\"Allow Claude to think out loud for longer for trickier questions and challenges.\",\"bd3NwKJU1r\":\"For Team accounts, only Premium seats can access Claude through {clientName}\",\"bdcMGyaa/s\":\"Open menu\",\"bf8Sy2Bveo\":\"Create an AI brainstorming tool that helps teams generate planning ideas.\\nThe tool should ask for context like company name, product, timeline, team goals, and what type of brainstorming session they want (product development, marketing, etc.).\\nWhen they click generate, it should use Claude API to first understand the company/product, then create 6 relevant ideas based on that understanding. Show Claude’s understanding summary so users know it’s not just generic templates.\\nMake it look modern and polished with cards, gradients, and good spacing. Each idea should show priority, effort needed, and impact level. Include a fallback if the API doesn’t work.\\nThe whole point is proving the ideas are contextual to their actual company, not just random suggestions.\",\"bfd0IMVjQT\":\"Turn off memory\",\"bgGBA2IrQh\":\"See where your verified domains are being used across Anthropic organizations. All accounts under your verified domains have the ability to use SSO as long as they have been added to the SSO application in your IdP.\",\"bgzDSDv82o\":\"Upload a new version\",\"bh4rlKfcgE\":\"Government\",\"bhN9Hq4L1e\":\"Delete your account\",\"bhRxZdeiXN\":\"Chats per day\",\"bhuRmwJBaN\":\"versions\",\"biUnCTBtnQ\":\"Warming up the engines...\",\"biijo1+gxc\":\"Desktop extensions\",\"bk8tuJl/tJ\":\"Select report reason\",\"bkBPnimOL+\":\"Explore architectural concepts\",\"bkF9le2jiA\":\"Missing scope parameter\",\"bl2rUXGRoK\":\"Enable apps your team can securely connect to Claude for more personalized assistance in their chats.\",\"blWvagsLt7\":\"Models\",\"blnqK9/b82\":\"Claude for Chrome can be used on these sites\",\"bm+XRYDg92\":\"SAML Attribute Mappings\",\"bm42ueO7t1\":\"Greetings, whoever you are\",\"bmB0AwkqUW\":\"Setup SSO\",\"bmbBuAsqTt\":\"Can you build a minimalist rhyming clock that uses the Claude API to tell the time with a new poem every minute? Only show the poem, and when there’s a new poem, I want the poem to type in. Use skeuomorphism to make this look like an actual clock with a text display. I want this to look like a high-tech piece of sleek engineering like Dieter Rams.\",\"bnGGwdCceV\":\"Enable connectors for Claude to use in research\",\"bnRxzOhnEE\":\"Invalid date.\",\"boHYJa9z2K\":\"Invite email address\",\"boJw4UzEkA\":\"{percentOff}% off for {durationInMonths, plural, one {# month} other {# months}}\",\"bw4uiEG/kB\":\"Long prompts or documents may take multiple minutes to respond\",\"bx0I0jUzuD\":\"How we use your data\",\"bxF5LBtAbe\":\"Updates to Consumer Terms and Policies\",\"bxv59Vvssz\":\"Just now\",\"bzY1U8fiZs\":\"Plan business acquisitions\",\"bzYWNlBFMV\":\"No projects matching “{search}”\",\"bzaykhSB2a\":\"Manage permissions\",\"bzmcF8EN8q\":\"Visit AWS Marketplace\",\"c/Hjsh8c90\":\"Start a new chat\",\"c0PrrAFgH2\":\"When AI can interact with web pages, it creates meaningful value, but also opens up new risks. We're releasing Claude for Chrome as a limited research preview to learn from real-world use.\",\"c1Mk4Kz2+g\":\"Learn guitar in 90 days\",\"c1zgtNFdB8\":\"Premium seat\",\"c2+pp7T4ws\":\"Flashcards\",\"c2HBgZtgDR\":\"Public projects are disabled by your organization\",\"c2T59IBYsH\":\"Improve technical skills\",\"c3akKO6gKx\":\"Turn on extra usage\",\"c4hRLOnYpQ\":\"Remind me later\",\"c5+JRMBv/Y\":\"Upgrade plan\",\"c5oBAmpUAc\":\"Drag and drop research materials like draft papers, source notes, or literature reviews to help Claude provide targeted academic guidance.\",\"c6E7Ns074y\":\"Find the most compelling stories about an important topic from my docs\",\"c6IvRW7tX0\":\"Finish later\",\"c7QBwTGpyt\":\"Your IT administrator has blocked new account creation and you are not a member of any existing organizations. Please contact your IT administrator for access.\",\"c7bqWsRlDO\":\"Practice salary negotiations\",\"c7dEfbGyLk\":\"You are currently viewing from your personal account. \",\"c9XxyGP4pu\":\"Look through my emails and tell me where I’m avoiding something important\",\"cAAM/L4Sqy\":\"Save 50%\",\"cB/2zxlPUj\":\"Enter IdP group name\",\"cDMCfdBaCt\":\"You’re about to 