e title in the top-left and theme toggle top-right.\",\"r2G82YYBXn\":\"Click here to confirm your scheduled seat downgrade\",\"r2Qwbqbb9d\":\"Take this Artifact with you in a new chat with Claude and evolve it with your own unique spin.\",\"r3TPXlYFoi\":\"Add to global blocklist\",\"r3xR9e5TXy\":\"Analyze literary themes\",\"r5qYNnrGq5\":\"AI-powered artifacts\",\"r65HKpZU8I\":\"Only invited members can view and use this project\",\"r6P7kLapjf\":\"Contemplating, stand by...\",\"r80/2fFyeU\":\"Open in Drive\",\"r8YSLkTFDi\":\"Installed on your computer\",\"r9ELLACQn2\":\"Installing...\",\"rAoWjwnNEN\":\"Accessing your accounts or files\",\"rBZ2BdKQ7E\":\"$$0 for {trialDays} days\",\"rBj9IbMve1\":\"Next page\",\"rBjbD8bHKt\":\"SSO Authentication Error\",\"rCS/p9QoRY\":\"Improve my habits\",\"rCjtxDkG3S\":\"Guide me through a decision-making framework for a life choice\",\"rD53CSi6zK\":\"Code with Claude in\u003cbr\u003e\u003c/br\u003eyour IDE\",\"rEAWJr+6as\":\"Max 5x more usage than Pro\",\"rELDbByu8U\":\"Refresh\",\"rFjCvt98HU\":\"DEMO\",\"rGgpAjWSZl\":\"Reset inbox\",\"rHQiBDkDW3\":\"Claude can use tools to give you more relevant answers. You can turn them on or off in any chat.\",\"rIDePnNAwI\":\"Remove emails with errors to continue\",\"rIrah18aGe\":\"Product Management\",\"rJQDmlVOoX\":\"Interrupted\",\"rJhzRbgHY6\":\"Happy Sunday\",\"rKQPgfPvWS\":\"More options for {label}\",\"rKg5l5pnXe\":\"Unknown payment method\",\"rLTunFSwyh\":\"Searching deeper...\",\"rLbkjWAPUf\":\"Develop integration strategies\",\"rM4Seq3s8V\":\"{emailList} {count, plural, one {is not a valid email.} other {are not valid emails.}}\",\"rOG4NTQxcH\":\"Extensions\",\"rOcW3/sMpR\":\"Wallet balance\",\"rQoNAJyEVw\":\"Update\",\"rR3XvA5qdn\":\"Investigate scientific mysteries\",\"rS2iOWRASM\":\"OAuth Client ID (optional)\",\"rSHZ6kYY89\":\"If the problem persists \u003clink\u003econtact support\u003c/link\u003e for assistance.\",\"rSmKjXFhg5\":\"Generate gift or travel ideas\",\"rTrgwtfp2h\":