"4-week workout for bad knees\",\"zl6fNbo7RW\":\"Thought process\",\"zlhFlvfeii\":\"Payment failed. Please try again with a different payment method.\",\"zmLm6bD2r6\":\"Where should we start?\",\"zmjMfMgJOo\":\"Design\",\"zn13x6im3p\":\"Lines of Code\",\"zn5JnPWJAR\":\"Get started for free\",\"zoSAy0lzPk\":\"Invoices are not available for AWS Marketplace customers. Please visit the AWS Billing Console to view your invoices.\",\"zoXM3bL+ha\":\"Bring your knowledge\",\"zpLemdjbvG\":\"Manage seats\",\"zpQpVdGTYa\":\"HTTP allowed in development only\",\"zpk1ulYQL3\":\"Allow the use of your chats and coding sessions to train and improve Anthropic AI models. \u003clearnMoreLink\u003eLearn more\u003c/learnMoreLink\u003e.\",\"zq12PeCzC4\":\"Continue with your Claude.ai account to authenticate connections\",\"zqkUZeVH+L\":\"Editing this message will create a new conversation branch. You can switch between branches using the arrow navigation buttons.\",\"zqrN+N+vQJ\":\"You can access this page in one of your Team organizations\",\"zreH4pXxYz\":\"No files found\",\"zrk6McdUOM\":\"Reassign seat to {tier}?\",\"ztycMBGO3C\":\"Renew your plan to restore access.\",\"zuBzxY6QwA\":\"Claude Max, Pro or Team is required to connect to Claude Code\",\"zvWv7FFtPu\":\"This action will:\",\"zvbn/aOHpa\":\"Use a different email\",\"zwTmNQr7gL\":\"Error checking requirements...\",\"zxIaf1dj/2\":\"Subtotal\",\"zxj2GhSJqe\":\"Last updated {time}\",\"zyxxt7OHPv\":\"Allow Claude to search\",\"zzAr6WXkVb\":\"Mini Claude\",\"zzOZLy0ngS\":\"There was an error verifying your code. If the problem persists \u003clink\u003econtact support\u003c/link\u003e for assistance.\",\"secret:pear_bottle_title\":\"Claude Code, now in Desktop preview\",\"secret:pear_bottle_description\":\"Build features, fix bugs, and prototype right in your codebase\",\"secret:lazy_apple_leaf\":\"New session\",\"secret:hello_panda_title\":\"Start coding\",\"secret:cooking_pear_tree\":\"VS Code\",\"secret:skiing_peach_title\":\"Let's git coding\",\"secret:skiing_peach_subtitle\":\"Code with Claude in your local directories or connect to Github to code in the cloud\",\"secret:skiing_peach_button\":\"Install Claude Code dependencies\",\"secret:frozen_maple_branch\":\"Desktop\",\"secret:copper_oak_trunk\":\"Worktree location\",\"secret:silver_birch_root\":\"Where to store git worktrees for isolated coding sessions\",\"secret:rusty_anchor_trust_title\":\"Trust this workspace?\",\"secret:rusty_anchor_trust_desc\":\"Claude Code may read, write, or execute files in this directory. Only proceed if you trust this workspace.\",\"secret:rusty_anchor_trust_security\":\"Read our \u003csecurityLink\u003esecurity guide\u003c/securityLink\u003e for more information.\",\"secret:rusty_anchor_trust_sources\":\"Execution allowed by:\",\"secret:rusty_anchor_trust_cancel\":\"Cancel\",\"secret:rusty_anchor_trust_accept\":\"Trust Workspace\",\"secret:dancing_coral_welcome_title\":\"Welcome to Claude Code!\",\"secret:dancing_coral_welcome_subtitle\":\"Your agentic coding partner that works directly in your codebase.{br}Now with a simple, visual interface.\",\"secret:dancing_coral_warning\":\"Claude Code may read, write, or execute files in this folder. This can pose security risks, so only use Claude Code in folders you trust.\",\"secret:crystal_muffin_bicycle\":\"This artifact requires these connections to work fully. Anthropic can’t guarantee third-party integrations. Use at your own risk.\",\"secret:penguin_tomato_umbrella\":\"This artifact requires specific connections to fulfill its full potential. Review what you’re comfortable sharing with Claude.\",\"secret:wizard_banana_telescope\":\"Enable artifact connectors\",\"secret:rainbow_pickle_harmonica\":\"Let team members work with artifacts that use data from external sources. \",\"secret:disco_ferret_saxophone\":\"Learn more\",\"secret:velvet_pancake_thunder\":\"When Can We Meet?\",\"secret:crimson_butterfly_ocean\":\"Let Claude be your Executive Assistant and find a time when everyone can meet\",\"secret:golden_pickle_symphony\":\"$24\",\"secret:marble_cactus_rainbow\":\"Email Reply Drafter\",\"secret:turquoise_waffle_mountain\":\"Save time by using AI to sift through your inbox and draft quick replies to emails\",\"secret:bronze_umbrella_whisper\":\"$25\",\"secret:silver_donut_carnival\":\"Contact Email History Analyzer\",\"secret:amber_sandwich_nebula\":\"Transform email threads into organized summaries with key topics, action items, and conversation timeline\",\"secret:copper_banana_fortress\":\"Create a React Contact Email Analyzer that helps users review their email history with specific contacts, using the Gmail MCP in the artifact. Main Features: - Email input field and time period selector (Past Week, Month, 3 Months, 6 Months, Year) - Default to Past Month - Search Gmail for emails to/from that contact in the selected timeframe - Generate a summary showing: total conversations, timeline of emails, main topics discussed, and action items - Save the last 10 searches so users can quickly re-run them What to Display: - Overview section with total email count - Timeline showing email dates, subjects, and previews - Key Topics as clickable tags - Action Items as a simple list - Search history dropdown when clicking the email field\",\"secret:velvet_cupcake_spark\":\"This artifact wants to access shared data that other users of this artifact can see. You might see unverified content from others, and any data you save will be visible to them. Make sure you aren’t sharing sensitive information.\",\"secret:silver_apple_jungle\":\"Clear storage\",\"secret:golden_pear_forest\":\"Are you sure you want to clear the storage? This will delete all the data you have in this artifact and can’t be recovered. Shared artifacts won’t be affected.\",\"secret:cotton_camel_pyramid\":\"Failed to clear storage. Please try again.\",\"secret:sky_linked_comet\":\"Guest pass\",\"secret:luminous_river_stone\":\"Gift a week of Claude Code\",\"secret:radiant_mountain_sky\":\"Send a guest pass to a friend. They'll get a free week to see what they can build with Claude.\",\"secret:silver_frost_meadow\":\"Terms apply\",\"secret:sew_ball_disco\":\"Piloting Claude for Chrome\",\"secret:random_mountain_band\":\"Now Claude can navigate, click buttons, and fill forms—right in your browser. Max users get early access to test, explore, and shape what’s next.\",\"secret:quantum_rabbit_telescope\":\"Claude for Chrome\",\"secret:cosmic_butterfly_piano\":\"Try Claude for Chrome\",\"secret:open_pelican_water\":\"Add to Chrome\",\"secret:golden_bridge_adventure\":\"Meet Claude for Chrome\",\"secret:velvet_moon_safari\":\"When AI can interact with web pages, it creates meaningful value, but also opens up new risks. We’re releasing\",\"secret:crystal_star_journey\":\"as a limited research preview to learn from real-world use.\",\"secret:mystic_ocean_harmony\":\"Our goal is to explore safe ways for AI to browse the web—not just for our products, but for the entire AI ecosystem.\",\"secret:compostable_centric_milk\":\"Install the Claude browser extension, and ask it to:\",\"secret:projection_pineapple_cloth\":\"Claude’s in your Chrome\",\"secret:fabric_research_panther\":\"Claude won’t work perfectly or risk-free on all websites or tasks.\",\"secret:phone_pillow_sleep\":\"Get familiar with the browser extension before surfing the world wide web.\",\"secret:brother_rolling_wire\":\"Ready to roam Chrome?\",\"secret:velvet_telescope_pizza\":\"I’m a Max plan subscriber. When do I get access?\",\"secret:banana_thunder_violin\":\"What shouldn’t I use this for?\",\"secret:jellyfish_waffle_lamp\":\"How do I control what Claude can access?\",\"secret:cinnamon_bicycle_moon\":\"What are the security risks I should know about?\",\"secret:penguin_whistle_taco\":\"When will other Claude plans get access?\",\"secret:marmalade_sock_galaxy\":\"We’re starting with 1,000 Max users and expanding gradually based on what we learn. Join the research preview waitlist and we’ll notify you when your access is ready, along with installation instructions and safety guidelines.\",\"secret:origami_doorknob_fog\":\"Avoid financial transactions, password management, or anything involving sensitive personal data. Start with trusted sites and familiar workflows where you’re comfortable having Claude take actions. Never use it for high-stakes decisions without careful supervision. And, of course, make sure your use complies with our\",\"secret:origami_doorknob_fog_link\":\"acceptable use policy\",\"secret:bubblegum_anchor_nest\":\"You decide which websites Claude can visit and what actions it can take. Claude asks permission before visiting new sites and before taking potentially risky actions like publishing content or making purchases. You can revoke access to specific websites anytime in settings. For trusted workflows, you can choose to skip all permissions, but you should supervise Claude closely. While some safeguards exist for sensitive actions, malicious actors could still trick Claude into unintended actions.\",\"secret:kaleidoscope_pretzel_cave\":\"Browser AI faces unique security risks, like prompt injection attacks, where malicious actors might try to trick Claude into unintended actions, such as sharing your bank information or deleting important files. While we’ve implemented protections, they aren’t full proof. Attack vectors are constantly evolving and Claude may hallucinate, leading to actions that you did not intend. We’ve shared our testing results, including possible attack scenarios, so you can make informed decisions, and strongly encourage you to\",\"secret:kaleidoscope_pretzel_cave_link\":\"read about the risks\",\"secret:kaleidoscope_pretzel_cave_end\":\"before using this product.\",\"secret:marshmallow_compass_yeti\":\"We’re focused on learning from Max plan users first during this experimental phase. As we improve safety and reliability based on real usage, we’ll gradually expand to other plans. Our timeline depends on what we discover during research preview.\",\"secret:cosmic_keyboard_mountain\":\"Unsubscribe from unwanted email chains\",\"secret:mystic_dolphin_harmonica\":\"Find apartments matching preferences\",\"secret:electric_pancake_wizard\":\"Extract and summarize key insights\",\"secret:velvet_thunder_butterfly\":\"Please help me unsubscribe from all promotional emails in my inbox that I haven’t opened in the last 3 months.\",\"secret:crystal_moonlight_pickle\":\"I’m looking for a 3-bedroom house in Seattle under $800K, with a garage and at least 1500sqft. Can you search Zillow and show me the top 5 options?\",\"secret:rainbow_telescope_dragon\":\"Can you analyze these meeting notes and extract the key action items and deadlines into a structured summary?\",\"secret:lunar_sandwich_telescope\":\"Help us build what’s next\",\"secret:cosmic_jelly_mountain\":\"Using this feature and giving feedback directly improves what Claude can do.\",\"secret:mystic_pretzel_ocean\":\"This is a Google extension. The use of information received from Google APIs will adhere to the Chrome Web Store User Data Policy, including the Limited Use requirements.\",\"secret:thunder_cookie_telescope\":\"Understand the risks\",\"secret:crystal_waffle_butterfly\":\"Claude brings AI directly to your browser, handling tasks and navigating sites for you. These new capabilities create risks bad actors may try to exploit.\",\"secret:velvet_pancake_harmonica\":\"Malicious actors can hide instructions in websites, emails, and documents that trick AI into taking harmful actions without your knowledge, including:\",\"secret:electric_muffin_dragon\":\"Accessing your accounts or files\",\"secret:rainbow_pickle_wizard\":\"Sharing your private information\",\"secret:cosmic_donut_mountain\":\"Making purchases on your behalf\",\"secret:mystic_cookie_ocean\":\"Taking actions you never intended\",\"secret:lunar_jelly_telescope\":\"Learn more about the risks\",\"secret:thunder_waffle_butterfly\":\"Read the blogpost\",\"secret:crystal_pretzel_harmonica\":\"How to browse safely\",\"secret:velvet_muffin_dragon\":\"This beta experience is designed for AI-experienced users who understand these safety measures.\",\"secret:electric_pickle_wizard\":\"Start with trusted sites\",\"secret:rainbow_donut_mountain\":\"Only grant permissions to familiar websites while you’re learning how Claude works.\",\"secret:quantum_browser_tornado\":\"The browser extension is a beta feature with unique risks—stay alert and protect yourself from bad actors.\",\"secret:saturn_cupcake_violin\":\"Review before sensitive actions\",\"secret:jupiter_brownie_guitar\":\"Always confirm before Claude handles financial, personal, or work-critical tasks.\",\"secret:neptune_cookie_piano\":\"Watch for malicious instructions\",\"secret:mercury_muffin_drums\":\"Be cautious if Claude behaves unexpectedly—some sites hide instructions to override yours.\",\"secret:venus_cake_flute\":\"Report issues immediately\",\"secret:mars_pastry_harp\":\"Help us improve by flagging any concerning behavior through the feedback options.\",\"secret:golden_butterfly_mountain\":\"Understand the risks\",\"secret:crimson_butterfly_garden\":\"Try Haiku 4.5 for a fast model that’s great for quick answers.\",\"secret:amber_forest_whisper\":\"Try it\",\"secret:silver_mountain_echo\":\"NEW\",\"secret:rainbow_garden_echo\":\"Everyday Claude\",\"secret:rainbow_butterfly_stream\":\"Great for everyday tasks\",\"secret:crystal_meadow_sunrise\":\"Smarter Claude\",\"secret:crystal_mountain_breeze\":\"Our most intelligent model yet\",\"secret:howdy\":\"{currentModelName}’s safety filters flagged this chat. Due to its advanced capabilities, {currentModelName} has additional safety measures that occasionally pause normal, safe chats. We’re working to improve this. Continue your chat with {fallbackModelName}, \u003cfeedback\u003esend feedback\u003c/feedback\u003e, or \u003clearnMore\u003elearn more\u003c/learnMore\u003e.\",\"secret:bogoso