ng events or understanding the current context. Use for: getting the current time, timezone questions (like 'what timezone am I in', 'PST or EST'), scheduling events, or understanding relative times like 'this afternoon' or 'tonight'. \"},\"user_location_v0\":{\"tool_description\":\"Get the user's current location. Always use this when the user asks: where am I, what's my location, show my position, show my current position, what neighborhood/city/state/country am I in, needs their location for emergency calls, finding parking near their location, weather queries (temperature, forecast, rain), or any question about their current geographic position. Also use this when queries refer to 'my city', 'my area', 'near me', 'locally', 'outside', or need the user's location as context for finding places. This returns location info but does not display a map - for map visualization with coordinates, use map_display_v0 separately.\",\"accuracy\":\"Represents the desired accuracy for the location. Can be one of these values : 'precise' or 'approximate'. Use 'precise' for: local recommendations (restaurants, coffee shops, stores, etc.), directions, navigation, finding nearest locations, requests with 'around here'/'near me'/'nearby', parking, or any request needing specific distance/proximity. Use 'approximate' only when the request just needs city/region context (like weather, general area info).\"},\"alarm_create_v0\":{\"tool_description\":\"Create an alarm for a specific time (e.g., 'wake me at 7 AM', 'set alarm for 3:30 PM', 'medication reminder at 2 PM', 'bedtime reminder at 10:30 PM'). Use for any time-based alert including labeled reminders that occur at a specific clock time daily (medication, vitamins, bedtime). Do not use for: countdown timers (use timer_create_v0), calendar events with dates (use event_create_v1), or any non-alarm requests.\",\"hour\":\"The hour for the alarm in 24-hour format (0-23).\",\"minute\":\"The minute for the alarm (0-59).\",\"message\":\"The message or label for the alarm.\",\"vibrate\":\"Whether the alarm should vibrate.\",\"days\":\"For a repeating alarm, an array of which weekdays it should repeat on. The weekdays are 1 index based, starting on Sunday.\"},\"timer_create_v0\":{\"tool_description\":\"Create a countdown timer for a duration (e.g., '5 minute timer', 'timer for 30 seconds'). Use for countdowns from a duration, not specific times.\",\"duration_seconds\":\"The duration of the timer in seconds.\",\"message\":\"The message or label for the timer.\"},\"message_compose_v0\":{\"tool_description\":\"Create a message template that the user can use to send messages. Use this whenever the user asks you to write, draft or send any kind of message or email. This will allow them to more easily share the message than if you respond without using this tool.\",\"kind\":\"The kind of message to create. Can be one of these values: 'email', 'textMessage', or 'other'.\",\"subject\":\"The subject of the message. Should only be included for email messages.\",\"body\":\"The body of the message\",\"summary_title\":\"A brief title that summarizes the message.\"},\"event_create_v0\":{\"tool_description\":\"Draft an event that the user can add to their calendar. This tool does not create the event itself, just the draft for the user to add it themselves. Always prefer use of the newer event_create_v1 tool that can add the event directly to the user's calendar unless the user has denied access to that tool, in which case you can use this tool as a fallback to be helpful. Be sure to respect the user's timezone: use the user_time_v0 tool to retrieve the current time and timezone.\",\"title\":\"The title of the event\",\"description\":\"A description of the event\",\"start_time\":\"A string representing the start datetime in ISO 8601 format.\",\"end_time\":\"A string representing the end datetime in ISO 8601 format.\",\"location\":\"The location of the event.\",\"all_day\":\"Whether the created event is an all-day event.\",\"recurrence\":{\"description\":\"Details about the recurrence of a calendar event, if any.\",\"rrule\":\"The rrule for how frequently the event repeats\",\"human_readable_frequency\":\"The human-readable frequency of the event, matching the rrule\",\"frequency\":\"The frequency of recurrence. Options are 'daily', 'weekly', 'monthly', 'yearly'\",\"interval\":\"The interval between recurrences (default: 1)\",\"day_of_month\":\"Integer for day of the month (1-31) for monthly recurrence.\",\"days_of_week\":\"Array representing days of the week for weekly recurrence. Options are 'SU', 'MO', 'TU', 'WE', 'TH', 'FR', 'SA'.\",\"position\":\"Integer position in month (1-4 or -1 for last) for monthly recurrence by weekday.\",\"months\":\"Array representing months for yearly recurrence. Month number (1-12).\",\"end\":{\"description\":\"A representation of the end conditional of a reccurent event.\",\"type\":\"Type of recurrence end. Options are 'count', 'until'.\",\"count\":\"Number of occurrences if type is 'count'.\",\"until\":\"End date in ISO 8601 format if type is 'until'.\"}}},\"map_display_v0\":{\"tool_description\":\"Renders location markers (requires lat/long points) on a map. Use this when the user asks about locations like restaurants, stores, parks, or other businesses or geographic landmarks that could benefit from being displayed on a map. Be proactive about using this tool when it seems helpful, such as when the user asks for recommendations nearby coffee shops or restaurants. You can use placeholder coordinates if exact ones aren't available. Do not use for: navigation/directions queries (like 'navigate to', 'how do I get to', 'give me directions') or just getting user location (use user_location_v0).\",\"title\":\"A title that describes what the map shows.\",\"markers\":{\"description\":\"A list of up to 10 markers to be rendered on a map.\",\"items\":{\"description\":\"An object representing a marker to be rendered on a map.\",\"latitude\":\"The latitude of the marker's location.\",\"longitude\":\"The longiture of the marker's location.\",\"title\":\"A human-readable name for the marker. This should be short and descriptive.\",\"label\":\"Label for the marker. This should be concise, useful and informative. Maximum 3 words.\"}}},\"reminder_create_v0\":{\"tool_description\":\"Create one or more reminders in the Reminders app. Users often use Reminders for todos, shopping lists, groceries, etc. When it makes sense, suggest adding items to the user's reminders to be proactively helpful, especially if the user asks you explicitly to add items to a list. If you're unsure, ask for consent first. Always create a reminder per item for a list of items, eg a shopping or grocery list, unless asked to do otherwise. Reminders should be grouped by list ID; you may use an empty list ID to indicate that the default list should be used. Be sure to respect the user's timezone: use the user_time_v0 tool to retrieve the current time and timezone. Use when user says 'remind me', 'reminder', 'todo', or lists items to remember.\",\"reminder_lists\":{\"description\":\"Array of reminder lists, each containing reminders grouped by list name\",\"items\":{\"description\":\"A group of reminders for a specific list\",\"list_id\":\"ID of the reminder list. Must be obtained from a tool like reminder_list_search_v0 that returns a valid list ID. Omit or use empty string for default list.\",\"list_name\":\"Name of the reminder list (omit or use empty string for default list)\",\"reminders\":{\"description\":\"Array of reminders to add to this list\",\"items\":{\"description\":\"A reminder item to be created\",\"title\":\"The title/name of the reminder\",\"notes\":\"Additional notes or description for the reminder\",\"due_date\":\"Due date in ISO 8601 format (e.g., 2024-01-15T14:30:00Z)\",\"due_date_includes_time\":\"Whether the due date includes a specific time (true) or is all-day (false)\",\"completion_date\":\"The date at which the reminder was completed, if any (only specified by the user)\",\"priority\":\"Priority level of the reminder\",\"url\":\"URL to attach to the reminder\",\"alarms\":{\"description\":\"Array of alarms for this reminder\",\"items\":{\"description\":\"An alarm for the reminder\",\"type\":\"Type of alarm - absolute date/time or relative to due date\",\"date\":\"For absolute alarms: specific date/time in ISO 8601 format\",\"seconds_before\":\"For relative alarms: seconds before the due date (e.g., 900 for 15 minutes)\"}},\"recurrence\":{\"description\":\"Details about the recurrence of the reminder, if any\",\"rrule\":\"The rrule for how frequently the recurrence repeats\",\"human_readable_frequency\":\"The human-readable frequency of the event, matching the rrule\",\"frequency\":\"How often the recurrence repeats\",\"interval\":\"Interval between recurrences (e.g., 2 for every 2 weeks)\",\"day_of_month\":\"Integer for day of the month (1-31) for monthly recurrence.\",\"position\":\"Integer position in month (1-4 or -1 for last) for monthly recurrence by weekday.\",\"months\":\"Array representing months for yearly recurrence. Month number (1-12).\",\"days_of_week\":\"Array representing days of the week for weekly recurrence\",\"end\":{\"description\":\"When the recurrence ends\",\"type\":\"End by specific date (until) or after number of occurrences (count)\",\"count\":\"For count type: number of occurrences\",\"until\":\"For until type: end date in ISO 8601 format\"}}}}}}},\"reminder_update_v0\":{\"tool_description\":\"Updates existing reminders in the user's Reminders app. Can modify multiple reminders at once, changing properties like title, notes, due date, priority, completion status, list assignment, alarms, and recurrence. Each reminder is identified by its unique ID obtained from reminder search. Be sure to respect the user's timezone: use the user_time_v0 tool to retrieve the current time and timezone.\",\"reminder_updates\":{\"description\":\"Array of reminder update requests. Each item specifies a reminder ID and the fields to update. Only include fields that should be changed.\",\"items\":{\"description\":\"A reminder to update with new values\",\"id\":\"The unique ID of the reminder to update. This ID must be obtained from a previous reminder search or list operation.\",\"list_id\":\"Move the reminder to a different list by specifying the target list ID. Must be obtained from a prior reminder tool like reminder_list_search_v0. If omitted, the reminder stays in its current list.\",\"list_name\":\"Move the reminder to a different list by specifying the target list name. If omitted, the reminder stays in its current list. Example: 'Work' or 'Groceries'\",\"title\":\"New title/name for the reminder. This is the main text that appears for the reminder. If omitted, the title remains unchanged.\",\"notes\":\"Additional notes or description for the reminder. Can contain detailed information, URLs, or context. Set to empty string to clear existing notes.\",\"due_date\":\"ISO 8601 formatted date/time when the reminder is due. For all-day reminders, use date only (YYYY-MM-DD). For specific times, include time and timezone (YYYY-MM-DDTHH:MM:SS±HH:MM). Set to null to remove due date.\",\"due_date_includes_time\":\"Whether the due date includes a specific time (true) or is all-day (false). Use false for date-only reminders like 'Due Tuesday'. Use true when a specific time matters like 'Meeting at 2pm'.\",\"completion_date\":\"ISO 8601 formatted date/time to mark the reminder as completed. Providing any value marks it complete. Set to null to mark as incomplete.\",\"priority\":\"Priority level for the reminder. Helps organize tasks by importance. Only specify when it seems to add value.\",\"url\":\"Associated URL for the reminder. Can be a website, document link, or any URL.\",\"alarms\":{\"description\":\"Notification alerts for the reminder. Can have multiple alarms. Each alarm is either absolute (specific date/time) or relative (minutes/hours before due date). Empty array removes all alarms.\",\"items\":{\"description\":\"An alarm notification for the reminder\",\"type\":\"Type of alarm. 'absolute' for specific date/time (e.g., 'Alert on Jan 15 at 9am'). 'relative' for time before due date (e.g., 'Alert 15 minutes before').\",\"date\":\"For absolute alarms only: ISO 8601 formatted date/time when the alarm should trigger. Example: '2024-01-15T09:00:00-08:00'\",\"seconds_before\":\"For relative alarms only: Number of seconds before the due date to trigger the alarm. Example: 900 for 15 minutes, 3600 for 1 hour, 86400 for 1 day.\"}},\"recurrence\":{\"description\":\"Details about the recurrence of the reminder, if any.\",\"rrule\":\"The rrule for how frequently the reminder repeats\",\"human_readable_frequency\":\"The human-readable frequency of the reminder, matching the rrule\",\"frequency\":\"The frequency of recurrence. Options are 'daily', 'weekly', 'monthly', 'yearly'\",\"interval\":\"The interval between recurrences (default: 1)\",\"day_of_month\":\"Integer for day of the month (1-31) for monthly recurrence.\",\"days_of_week\":\"Array representing days of the week for weekly recurrence. Options are 'SU', 'MO', 'TU', 'WE', 'TH', 'FR', 'SA'.\",\"position\":\"Integer position in month (1-4 or -1 for last) for monthly recurrence by weekday.\",\"months\":\"Array representing months for yearly recurrence. Month number (1-12).\",\"end\":{\"description\":\"A representation of the end conditional of a reccurent reminder.\",\"type\":\"Type of recurrence end. Options are 'count', 'until'.\",\"count\":\"Number of occurrences if type is 'count'.\",\"until\":\"End date in ISO 8601 format if type is 'until'.\"}}}}},\"reminder_delete_v0\":{\"tool_description\":\"Deletes existing reminders from the user's Reminders app. Can delete multiple reminders at once by specifying their unique IDs. Each reminder is permanently deleted. Exercise caution before deleting reminders and be sure this is what the user wants.\",\"reminder_deletions\":{\"description\":\"Array of reminder deletion requests\",\"items\":{\"description\":\"A reminder to delete from the user's Reminders app\",\"id\":\"The unique ID of the reminder to delete. Must be obtained from a previous reminder operation.\",\"title\":\"Optional but recommended title of the reminder for immediate display in the UI\"}}},\"reminder_search_v0\":{\"tool_description\":\"Search and retrieve reminders from the user's Reminders app. When it makes sense, you may suggest searching the user's reminders to be proactively helpful. If you're unsure, ask for consent first.\",\"list_id\":\"Specific list ID to search in\",\"list_name\":\"Specific list name to search in (used if list_id not provided)\",\"status\":\"Filter by completion status. Can be 'incomplete' or 'completed'. Default is 'incomplete'.\",\"date_from\":\"For incomplete: reminders due after this date. For completed: reminders completed after this date (ISO 8601)\",\"date_to\":\"For incomplete: reminders due before this date. For completed: reminders completed before this date (ISO 8601)\",\"search_text\":\"Search text to find in reminder titles and notes\",\"limit\":\"Maximum number of reminders to return per list (default: 100)\"},\"reminder_list_search_v0\":{\"tool_description\":\"Get available reminder lists from the user's Reminders app with optional search filtering. The number of lists is usually small so filter parameters are rarely necessary.\",\"search_text\":\"Optional search text to find matching list names (e.g., 'groceries' to find grocery-related lists)\"},\"calendar_search_v0\":{\"tool_description\":\"List all calendars available to the user\"},\"event_search_v0\":{\"tool_description\":\"Search for calendar events\",\"calendar_id\":\"The ID of the calendar to search in. If not provided, searches all calendars\",\"start_time\":\"Start time of the search range. If not provided, search from beginning of time. MUST USE ISO 8601 datetime format\",\"end_time\":\"End time of the search range. If not provided, search until end of time. MUST USE ISO 8601 datetime format\",\"limit\":\"Maximum number of events to return. If not provided, this defaults to 50.\",\"include_all_day\":\"Whether to include all-day events in the search results. Defaults to true.\"},\"event_create_v1\":{\"tool_description\":\"Create calendar events using the user's Calendar app. Create calendar events for: meetings, appointments, dinners, or scheduled activities. Use when user says 'schedule', 'add to calendar', 'book time', or mentions specific dates/times with activities (e.g. 'dinner at Eleven Madison Park at 7 PM'). Always prefer this tool over the older event_create_v0 tool unless the user denies permission to use this tool. Be sure to respect the user's timezone: use the user_time_v0 tool to retrieve the current time and timezone. Check the current time first with user_time_v0 to understand relative dates like 'today', 'tomorrow', 'this evening'.\",\"new_events\":{\"description\":\"Array of new events to create. All times must be in ISO 8601 datetime format.\",\"items\":{\"description\":\"A calendar event to create\",\"all_day\":\"Whether this is an all-day event\",\"attendees\":\"List of attendee email addresses. Not supported on iOS.\",\"availability\":\"How the time should be shown (busy, free, or tentative)\",\"calendar_id\":\"The ID of the calendar to add the event to. If not provided, uses the primary calendar\",\"end_time\":\"End time in ISO 8601 datetime format\",\"event_description\":\"Detailed description of the event\",\"location\":\"Location where the event takes place\",\"nudges\":{\"description\":\"List of reminders for the event\",\"items\":{\"description\":\"A reminder notification\",\"method\":\"Notification method. Possible values are: email, sms, alarm, notification\",\"minutes_before\":\"Number of minutes before the event to send the reminder\"}},\"recurrence\":{\"description\":\"Details about the recurrence of a calendar event, if any.\",\"rrule\":\"The rrule for how frequently the event repeats\",\"human_readable_frequency\":\"The human-readable frequency of the event, matching the rrule\",\"frequency\":\"The frequency of recurrence. Options are 'daily', 'weekly', 'monthly', 'yearly'\",\"interval\":\"The interval between recurrences (default: 1)\",\"day_of_month\":\"Integer for day of the month (1-31) for monthly recurrence.\",\"days_of_week\":\"Array representing days of the week for weekly recurrence. Options are 'SU', 'MO', 'TU', 'WE', 'TH', 'FR', 'SA'.\",\"position\":\"Integer position in month (1-4 or -1 for last) for monthly recurrence by weekday.\",\"months\":\"Array representing months for yearly recurrence. Month number (1-12).\",\"end\":{\"description\":\"A representation of the end conditional of a reccurent event.\",\"type\":\"Type of recurrence end. Options are 'count', 'until'.\",\"count\":\"Number of occurrences if type is 'count'.\",\"until\":\"End date in ISO 8601 format if type is 'until'.\"}},\"start_time\":\"Start time in ISO 8601 datetime format\",\"status\":\"Status of the event (confirmed, tentative, or cancelled)\",\"title\":\"Title of the event\"}}},\"event_delete_v0\":{\"tool_description\":\"Delete calendar events. Be very careful before deleting events as this action cannot be easily undone. Be sure that this is what the user wants.\",\"removed_events\":{\"description\":\"Array of events to delete\",\"items\":{\"description\":\"A calendar event to delete\",\"calendar_id\":\"The ID of the calendar containing the event\",\"event_id\":\"The ID of the event to delete\",\"recurrence_span\":{\"description\":\"When deleting a recurrent event, this defines how the deletion should be applied.\",\"option\":\"The scope of deletion for a recurring event. Options are 'instance' or 'series'. 'Instance' will delete a single event in the series, while 'series' will delete the entire series of recurring events.\",\"start_time\":\"When deleting a single event in a series, provide this as the ISO 8601 datetime timestamp for the instance that is being delete.\"}}}},\"event_update_v0\":{\"tool_description\":\"Update existing calendar events. Be sure to respect the user's timezone: use the user_time_v0 tool to retrieve the current time and timezone.\",\"event_updates\":{\"description\":\"Array of events to update\",\"items\":{\"description\":\"A calendar event to update\",\"all_day\":\"Whether this is an all-day event\",\"attendees\":\"List of attendee email addresses. Not supported on iOS.\",\"availability\":\"How the time should be shown (busy, free, or tentative)\",\"calendar_id\":\"The ID of the calendar containing the event\",\"end_time\":\"End time in ISO 8601 datetime format\",\"event_description\":\"Detailed description of the event\",\"event_id\":\"The ID of the event to update\",\"location\":\"Location where the event takes place\",\"nudges\":{\"description\":\"List of reminders for the event\",\"items\":{\"description\":\"A reminder notification\",\"method\":\"Notification method. Possible values are: email, sms, alarm, notification\",\"minutes_before\":\"Number of minutes before the event to send the reminder\"}},\"recurrence_span\":{\"description\":\"When updating a recurrent event, this defines how the modifications should be applied.\",\"option\":\"The scope of the update for a recurring event. Options are 'instance' or 'series'. 'instance' will apply updates to a single event in the series, and series will apply updates to the entire series of recurring events.\",\"start_time\":\"When updating a single event in a series, provide this as the ISO 8601 datetime timestamp for the instance that is being updated.\"},\"recurrence\":{\"description\":\"Details about the recurrence of a calendar event, if any.\",\"rrule\":\"The rrule for how frequently the event repeats\",\"human_readable_frequency\":\"The human-readable frequency of the event, matching the rrule\",\"frequency\":\"The frequency of recurrence. Options are 'daily', 'weekly', 'monthly', 'yearly'\",\"interval\":\"The interval between recurrences (default: 1)\",\"day_of_month\":\"Integer for day of the month (1-31) for monthly recurrence.\",\"days_of_week\":\"Array representing days of the week for weekly recurrence. Options are 'SU', 'MO', 'TU', 'WE', 'TH', 'FR', 'SA'.\",\"position\":\"Integer position in month (1-4 or -1 for last) for monthly recurrence by weekday.\",\"months\":\"Array representing months for yearly recurrence. Month number (1-12).\",\"end\":{\"description\":\"A representation of the end conditional of a reccurent event.\",\"type\":\"Type of recurrence end. Options are 'count', 'until'.\",\"count\":\"Number of occurrences if type is 'count'.\",\"until\":\"End date in ISO 8601 format if type is 'until'.\"}},\"start_time\":\"Start time in ISO 8601 datetime format\",\"status\":\"Status of the event Must be one of those values: confirmed, tentative, or cancelled\",\"title\":\"Title of the event\"}}}},\"group\":\"default\",\"is_device_based\":false},\"305860618\":{\"name\":\"305860618\",\"rule_id\":\"abandoned\",\"secondary_exposures\":[],\"value\":{\"console_default_model_override\":{},\"artifacts_enabled_by_default\":false,\"completions_limit_override\":{},\"chat_suggestion_chips\":false,\"default_on\":false,\"analysis_tool_experiment_enabled\":false,\"skip_phone_verification_experiment\":false,\"use_simplified_template\":false,\"use_annual_plan_discount\":false,\"route_to_aws\":false,\"use_obfuscated_model_names\":false,\"adjusted_unified_limit\":{},\"free_tier_available_models\":[],\"default_model\":\"\",\"allow_sticky_model_selection_override\":false,\"claude_ai_available_models\":{\"models\":[{\"model_id\":\"claude-sonnet-4-5-20250929\",\"minimum_tier\":\"free\"},{\"model_id\":\"claude-haiku-4-5-20251001\",\"minimum_tier\":\"free\"}]},\"enabled\":false},\"group\":\"abandoned\",\"is_device_based\":false,\"is_user_in_experiment\":false,\"is_experiment_active\":false,\"is_in_layer\":true,\"explicit_parameters\":[\"chat_suggestion_ch