her:\\n\\n- Recent doc changes - Any changes to Google Docs I've looked at in the past week. Show me what's new, who changed it, and why it matters.\\n\\n- Slack activity (last weekday):\\n  - Messages in my project channels that are important or mention me\\n  - Direct messages from team members\\n  - Threads I'm mentioned in that I haven't responded to yet\\n  - Any decisions or announcements I should know about\\n\\n- Organize by:\\n  - Urgent/needs my action today\\n  - Important context for my work\\n  - FYI/updates\\n\\nFormat: Keep it scannable - bullet points, not paragraphs. Focus on actionable items and key context.\\n\\nNote: If I don't have Slack or Google Docs connected, let me know I can do that in the Tools menu to get better summaries.\"},{\"title\":\"Draft email responses\",\"icon\":\"mailbox\",\"prompt\":\"Find my 5 most important unread or recent emails that need responses and draft replies for me.\\n\\nFor each email:\\n\\n- Identify why it's important (urgent request, key stakeholder, blocker, etc)\\n- Summarize what they're asking for\\n Draft a professional response\\n- Flag any action items or follow-ups\\n- Suggest priority (urgent, this week, can wait)\\n\\nOrganize by priority - most urgent first.\\n\\nTone: Professional but warm. Match the sender's tone where appropriate.\\n\\nWhat to include in drafts:\\n\\n- Direct answer to their question/request\\n- Any relevant context they need\\n- Clear next steps or timeline\\n- Call to action if needed\\n\\nI'll review and send them. If I don't have Gmail connected, let me know I can do that in the Tools menu.\"},{\"title\":\"Meeting prep\",\"icon\":\"activity\",\"prompt\":\"Help me prepare for my upcoming meeting by gathering everything I need to know.\\n\\nFirst, find my next meeting:\\n\\n- Pull the calendar invite details (attendees, time, location/link, description)\\n\\nThen, gather context:\\n\\n- Check for attached docs in the calendar invite\\n- If no docs attached, search Google Docs for relevant context:\\n  - Docs related to meeting attendees\\n  - Docs related to the meeting topic\\n  - Recent project updates from this team\\n- Check Slack for context:\\n  - Recent conversations in relevant channels\\n  - DMs with key attendees (especially if they're the organizer)\\n  - Any decisions or updates about this meeting's topic\\n\\nCreate a meeting brief with:\\n\\n- Meeting overview (what it's about, who's attending)\\n- Key context from docs/Slack\\n- Items to discuss or mention\\n- Questions to ask\\n- Any prep work needed before the meeting\\n\\nFormat: Keep it short and easy to skim right before the meeting starts.\\n\\nIf I don't have Google Calendar connected, let me know I can set that up in the Tools menu.\"},{\"title\":\"More\",\"icon\":\"arrowUpRight\",\"isExternal\":true,\"url\":\"https://go/agent-chat-prompts\"}]},\"group\":\"prestart\",\"is_device_based\":false,\"explicit_parameters\":[\"prompts\"],\"allocated_experiment_name\":\"2011487650\",\"is_user_in_experiment\":false,\"is_experiment_active\":false,\"undelegated_secondary_exposures\":[]},\"2309717417\":{\"name\":\"2309717417\",\"rule_id\":\"default\",\"secondary_exposures\":[],\"value\":{\"use_existing_payment_method\":true},\"group\":\"default\",\"is_device_based\":false,\"explicit_parameters\":[],\"undelegated_secondary_exposures\":[{\"gate\":\"segment:__managed__samcat_dogfooding\",\"gateValue\":\"false\",\"ruleID\":\"default\"},{\"gate\":\"samcat_dogfooding\",\"gateValue\":\"false\",\"ruleID\":\"default\"}]},\"2515064945\":{\"name\":\"2515064945\",\"rule_id\":\"default\",\"secondary_exposures\":[],\"value\":{\"move_survey\":false,\"allow_coupons\":false,\"allow_subscription_pausing\":false},\"group\":\"default\",\"is_device_based\":false,\"explicit_parameters\":[],\"undelegated_secondary_exposures\":[]},\"2677532104\":{\"name\":\"2677532104\",\"rule_id\":\"default\",\"secondary_exposures\":[],\"value\":{},\"group\":\"default\",\"is_device_based\":false,\"explicit_parameters\"